;; gorilla-repl.fileformat = 1

;; **
;;; # Regression test score
;;; 
;;; A score function to test the evolutionary algorithm side of the hybrid polynomial search.
;; **

;; @@
(ns regression-test-score
  (:require [gorilla-plot.core :as plot]
            [incanter.stats :as stats]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Some helper functions ... should make a libary at some point I suppose.
;; **

;; @@
(defn outer [xs ys] (vec (apply concat (mapv (fn [x] (mapv (fn [y] [x y]) ys)) xs))))

(defn transpose [m] (apply mapv vector m))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;regression-test-score/transpose</span>","value":"#'regression-test-score/transpose"}
;; <=

;; **
;;; Some test data, a simple polynomial sampled on an equally spaced x-y grid.
;; **

;; @@
(def xys (outer (range 0.0 1 0.1) (range 0.0 1 0.1)))

(def test-data (mapv (fn [[x y]] (+ (* 3.0 x x) (* 4.0 y))) xys))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;regression-test-score/test-data</span>","value":"#'regression-test-score/test-data"}
;; <=

;; **
;;; A function to calculate the value of a single term in the polynomial, at a particular value of the coordinates.
;; **

;; @@
;; Don't include constant terms here, that is x^0 == 0, not 1
;; Otherwise we would have potentially many constant terms.
(defn calculate-term-value
  [coord term]
  (apply + (mapv (fn [power value]
                  (if (zero? power)
                    0.0
                    (Math/pow value power)))
                term coord)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;regression-test-score/calculate-term-value</span>","value":"#'regression-test-score/calculate-term-value"}
;; <=

;; @@
(calculate-term-value [3.0 4.0] [1 2])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>19.0</span>","value":"19.0"}
;; <=

;; **
;;; The fit routine wants a matrix with the values of each term in the linear fit (i.e. each term in the polynomial) at each data point. This function makes just that.
;; **

;; @@
(defn calculate-term-matrix
  [coords poly]
  (mapv (fn [data-point] (mapv (partial calculate-term-value data-point) poly)) coords))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;regression-test-score/calculate-term-matrix</span>","value":"#'regression-test-score/calculate-term-matrix"}
;; <=

;; **
;;; This function uses the above to run incanter's linear fit on the data.
;; **

;; @@
(defn fit-poly
  [poly coords values]
  (stats/linear-model values (calculate-term-matrix coords poly)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;regression-test-score/fit-poly</span>","value":"#'regression-test-score/fit-poly"}
;; <=

;; **
;;; Testing it out. The test polynomial has just the right terms, so this should give us a perfect fit. The fit routine spits out a load of junk.
;; **

;; @@
(fit-poly [[0 1] [2 0]] xys test-data)
