;;; Test it out on a few different polynomials.
;; **

;; @@
(poly-score [[0 1] [2 0]] xys test-data)
(poly-score [[1 1] [2 2]] xys test-data)
(poly-score [[0 1] [2 0] [3 3]] xys test-data)
(poly-score [[2 1]] xys test-data)
